import React from 'react';
import logo from './logo.svg';
import './App.css';
import Great from './components/Great'
import Welcome from './components/Welcome'
import Hello from './components/Hello'

function App() {
  return (
    <div className="App">
      <Great name="Daniel" heroName="Procedural" >
        <p>This is Hilian</p>

      </Great>
      <Great name="Jose" heroName="Modularity" >

        <button>Action</button>
      </Great>
      <Great name="Chirindza" heroName="Facility" />
      {/*<Welcome/>*/}
      <Hello />
    </div>
  );
}

export default App;
